import LoginByThirdParty from "../../../api_handler/user_api_handler/user_api_handler";

async function login(googleUser) {
    const googlerUserId = googleUser.getBasicProfile().getId()
    const googlerUserAccessToken = googleUser.getAuthResponse(true).access_token
    let tMentorUser = await LoginByThirdParty(googlerUserId, googlerUserAccessToken)

    try {
        tMentorUser = await LoginByThirdParty(googlerUserId, googlerUserAccessToken)
    } catch(e) {

    }
    console.log(tMentorUser)
} 

export default login
